function App() {
  const [mode, setMode] = useState('dark');
  return (
    <>
      <Navbar title="Second title" aboutText='About' mode={mode}/>
      <div className="container p-4">
        <h1>My Name is {name}</h1>
      </div>
      <TextForm heading="This is a testing form."/>
      {/* <About/> */}
    </>
  );
}

export default App;
